1.When I call an onnx model about video super-resolution reconstruction via c++, the output image after the final result is a gray nine-pane grid, which should be a rgb image normally.

**System information**
- ONNX Runtime version (you are using):1..8.1+gpu

**Describe the solution you'd like**
In torch (pytorch/libtorch) there is a contiguous() method, by testing my results in libtorch deleting this method will get the same problem with onnx output, so using onnx there is no corresponding libtorch same method to solve this problem?

I hope you can understand my problem better through my code:
std::vector<Ort::Value> ort_outputs = session.Run(Ort::RunOptions{ nullptr }, input_names.data(),ort_inputs.data(),ort_inputs.size(),output_names.data(),3);
float* floatarr = ort_outputs[0].GetTensorMutableData<float>();
std::vector<float>results(outputSizeCount);
for (unsigned i = 0; i < outputSizeCount; i++)
{
	results[i] = floatarr[i];
}
cv::Mat output_tensor(results);
cv::Mat dest = output_tensor.reshape(3, { sr_h,sr_w }) * 255.0f;
cv::imwrite("E:/SR/RealBasic_pt/onnx_res1.png", dest);
Thanks.
